import React from "react";



let padToThree = (number) => (number <= 999 ? `00${number}`.slice(-3) : number);

function Pokecard1(props) {
  return (
    <div>
      {props.name} <img src={`https://assets.pokemon.com/assets/cms2/img/pokedex/detail/${padToThree(this.props.id)}.png`} alt="" />
    </div>
  );
}

export default Pokecard1;
